import React, { useState } from 'react';

const Video = ({ video, onVote, onDelete }) => {
  const { title, url, votes, uploadedDate } = video;

  const handleUpVote = () => {
    onVote(video, 'up');
  };

  const handleDownVote = () => {
    onVote(video, 'down');
  };

  const handleDelete = () => {
    onDelete(video);
  };

  return (
    <div>
      <h2>{title}</h2>
      <p>Uploaded on: {uploadedDate}</p>
      <iframe
        width="560"
        height="315"
        src={url}
        frameBorder="0"
        allowFullScreen
        title={title}
      ></iframe>
      <p>Votes: {votes}</p>
      <button onClick={handleUpVote}>Up Vote</button>
      <button onClick={handleDownVote}>Down Vote</button>
      <button onClick={handleDelete}>Delete</button>
    </div>
  );
};

export default Video;
